import React from "react"

export default function Contact(){

    return (
        <div className="contact">
            <h1>Contact</h1>
            <p>
                If you have any questions or comments, please contact me at:
                <br/>
                <a href="mailto:roboto.polito.it">roboto.polito@gmail.it</a>
            </p>
        </div>
    )
}
